document.addEventListener("DOMContentLoaded", () => {
    const hamburger = document.querySelector('.hamburger');
    const navLinks = document.querySelector('.nav-links');
    const lastModified = document.getElementById("lastModified");
    const currentYear = document.getElementById("currentyear");
   
    hamburger.addEventListener('click', () => {
        navLinks.classList.toggle('show');
        hamburger.textContent = navLinks.classList.contains('show') ? '✖' : '☰';
    });
  
    
    lastModified.textContent = `Last Modified: ${document.lastModified}`;
  
   
    currentYear.textContent = new Date().getFullYear();
  
   
    window.addEventListener('resize', () => {
        if (window.innerWidth >= 768) {
            navLinks.classList.remove('show');
            hamburger.textContent = '☰';
        }
    });
  });
  
  const products = [
    { productName: "JEANS",
        description: "Premium jeans which ranges from 6000 - 10000",
        productionDate: "2022, October, 30",
        
     
      imageUrl: "data:image/jpeg;base64,"
    },
    {
      productName: "POLO",
      description: "Quality polo which ranges from 4500-10000",
      productionDate: "2023, April, 10",
      
      imageUrl: "data:image/jpeg;base64,"
    },
    {
      productName: "GOWNS",
      description: "Top notch gowns which ranges fr4on 15000-30000",
      productionDate: "2020, December, 15",
      
      imageUrl: "data:image/jpeg;base64,"
      
    },
    {
      productName: "JUMPSUIT",
      description: "Beautiful jumpsuit for 9000",
      productionDate: "2022, June, 28",
    
      imageUrl:"data:image/jpeg;base64,"
     
    },
    {
      productName: "TOPS",
      description: "High class tops for 6000",
      productionDate: "2022, October, 30",
     
      imageUrl: "data:image/jpeg;base64,"
      
    }
  ];
  
  function createProductCard(productsArray) {
  const gallery = document.querySelector(".gallery");
  gallery.innerHTML = ""; 
  
  productsArray.forEach(product => {
    let card = document.createElement("section");
    let name = document.createElement("h3");
    let description = document.createElement("p");
    let productionDate = document.createElement("p");
    let img = document.createElement("img");
  
    name.textContent = product.productName;
    description.innerHTML = `<span class="label">Description:</span> ${product.description}`;
    productionDate.innerHTML = `<span class="label">Production Date:</span> ${product.productionDate}`;
    
    img.setAttribute("src", product.imageUrl);
    img.setAttribute("alt", `${product.productName} Product`);
    img.setAttribute("loading", "lazy");
  
    card.appendChild(name);
    card.appendChild(description);
    card.appendChild(productionDate);
    
    card.appendChild(img);
  
    gallery.appendChild(card);
  });
  }
  
  
  createProductCard(products);
  
  
  const searchInput = document.getElementById("search");
  searchInput.addEventListener("input", function () {
  const searchTerm = searchInput.value.toLowerCase();
  const filteredProducts = products.filter(product =>
    product.productName.toLowerCase().includes(searchTerm) ||
    product.description.toLowerCase().includes(searchTerm)
  );
  createProductCard(filteredProducts); 
  });
  
  
  const filterButtons = document.querySelectorAll(".filter-btn");
  filterButtons.forEach(button => {
  button.addEventListener("click", function () {
    const filter = button.getAttribute("data-filter");
    let filteredProducts;
    
    if (filter === "old") {
      filteredProducts = products.filter(product => new Date(product.productionDate).getFullYear() < 2023);
    } else if (filter === "new") {
      filteredProducts = products.filter(product => new Date(product.productionDate).getFullYear() >= 2020);
    
      filteredProducts = products;
    }
  
    createProductCard(filteredProducts); 
  });
  });
